  false,\n\t\"url\": null,\n\t\"notes\": \"The Tropical Atmosphere Ocean (TAO) Array
  of 55 moored buoys spans the tropical Pacific from longitudes 165u00c2u00b0E to
  95u00c2u00b0W between latitudes of approximately 8u00c2u00b0S and 9u00c2u00b0N.
  Moorings within the array measure surface meteorological and upper-ocean parameters
  and transmit most data in real time to shore via Service Argos. The array was part
  of the in-situ measurement portion of the Tropical Ocean-Global Atmosphere (TOGA)
  Program, a 10-year (1985 - 1994) study of climate variability on seasonal to interannual
  time scales, the most pronounced mode of which is the El Niu00c3u00b1o/Southern
  Oscillation (ENSO) phenomenon (McPhaden, 1993).\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
